import React from 'react';

import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>WELCOME</p>
        <p>I'm an undergraduate</p>
        <p>I'm a Software Engineer</p>
        <p>I'M ALLEN ZHAI</p>
      </header>
    </div>
  );
}

export default App;
